import './css/LegalAsp.css';
// import legacy from 'https://docs.google.com/document/d/1cgwVimpKDpb_Tou-WAiUfvJUCtsmGvOD/edit?usp=sharing&ouid=100948237123630890808&rtpof=true&sd=true'

function LegalAsp() {
    return (
        <div className="LegalAsp">

                <p>

                    Форма информированного согласия <a href='https://docs.google.com/document/d/1cgwVimpKDpb_Tou-WAiUfvJUCtsmGvOD/edit?usp=sharing&ouid=100948237123630890808&rtpof=true&sd=true' title="согласие.docx">посмотреть файл на google dricve</a>
                
                </p>

        </div>
    )
}

export default LegalAsp;
